// src/pages/Dashboard.js
import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

const Dashboard = () => {
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);

  useEffect(() => {
    const loadData = async () => {
      const response2023 = await fetch('/path/to/dados2023.csv');
      const response2024 = await fetch('/path/to/dados2024.csv');

      // Parsing the CSV files
      Papa.parse(response2023.body, {
        header: true,
        complete: (results) => {
          setData(prevData => [...prevData, ...results.data]);
        },
      });

      Papa.parse(response2024.body, {
        header: true,
        complete: (results) => {
          setData(prevData => [...prevData, ...results.data]);
        },
      });
    };

    loadData();
  }, []);

  // Apply filtering logic based on your requirements here

  return (
    <div>
      <h1>Visão Geral</h1>
      {/* Implementação da seção de comparação e tabela de dados */}
      <table>
        <thead>
          <tr>
            <th>CNPJ</th>
            <th>Cód Cliente</th>
            <th>Nome Fantasia</th>
            <th>Razão Social</th>
            <th>Bairro</th>
            <th>Município</th>
            <th>Cód Produto</th>
            <th>Produto</th>
            <th>Embalagem</th>
            <th>QT</th>
            <th>Total</th>
            <th>RCA</th>
            <th>Nome Vendedor</th>
            <th>Nome Supervisor</th>
            <th>Cód Dept</th>
            <th>Departamento</th>
            <th>Cond Venda</th>
            <th>DT FAT</th>
            <th>Segmento</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.map((item, index) => (
            <tr key={index}>
              <td>{item.CNPJ}</td>
              <td>{item.COD_CLIENTE}</td>
              <td>{item.NOME_FANTASIA}</td>
              <td>{item.RAZAO_SOCIAL}</td>
              <td>{item.BAIRRO}</td>
              <td>{item.MUNICIPIO}</td>
              <td>{item.COD_PROD}</td>
              <td>{item.PRODUTO}</td>
              <td>{item.EMBALAGEM}</td>
              <td>{item.QT}</td>
              <td>{item.TOTAL}</td>
              <td>{item.RCA}</td>
              <td>{item.NOME_VENDEDOR}</td>
              <td>{item.NOME_SUPERVISOR}</td>
              <td>{item.COD_DEPTO}</td>
              <td>{item.DEPARTAMENTO}</td>
              <td>{item.COND_VENDA}</td>
              <td>{item.DT_FAT}</td>
              <td>{item.SEGMENTO}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
